import React from 'react';
import { Link } from 'react-router-dom';

const CuratorNavbar = () => (
  <nav>
    <ul>
      <li><Link to="/curator">Dashboard</Link></li>
      <li><Link to="/curator/exhibition-highlights">Exhibition Highlights</Link></li>
      <li><Link to="/curator/visitor-feedback">Visitor Feedback</Link></li>
      <li><Link to="/curator/insights">Curator Insights</Link></li>
      <li><Link to="/curate-artworks">Curate Artworks</Link></li>
      <li><Link to="/review-submissions">Review Submissions</Link></li>
      <li><Link to="/profile">Profile</Link></li>
    </ul>
  </nav>
);

export default CuratorNavbar;
